import React, { Component } from 'react';
import admin from './admin'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
          <admin />
        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    );
  }
}

export default App;
